/* Procedure structure for procedure `USP_GET_ALL_COMPANY_SCORE` */

/*!50003 DROP PROCEDURE IF EXISTS  `USP_GET_ALL_COMPANY_SCORE` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `USP_GET_ALL_COMPANY_SCORE`(p_year varchar(4))
BEGIN
	#drop temp table if exists
	drop temporary table if exists temp_score; 
	#create temp tables	
	create temporary table temp_score(shortName varchar(255), score decimal(18,2));
	#insert into temp tables
	#insert into temp_score select c.shortName, floor(1 + rand() * (100 - 1 +1)) from md_company c; 
	insert into temp_score values("BOB",45);
	insert into temp_score values("BPC", 55);
	insert into temp_score values("BT", 97);
	insert into temp_score values("CDCL", 77);
	insert into temp_score values("DGPC", 78);
	insert into temp_score values("DCL", 78);
	insert into temp_score values("DCCL", 79);
	insert into temp_score values("DPL", 75);
	insert into temp_score values("KIL", 71);
	insert into temp_score values("MSPCL", 87);
	insert into temp_score values("NRDCL", 86);
	insert into temp_score values("SMCL", 81);
	insert into temp_score values("TTPL", 65);
	select * from temp_score s order by s.score asc;
	drop temporary table if exists temp_score; 
	
    END */$$
DELIMITER ;

/* Procedure structure for procedure `USP_GET_EVAL_SCORE` */

/*!50003 DROP PROCEDURE IF EXISTS  `USP_GET_EVAL_SCORE` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `USP_GET_EVAL_SCORE`(p_year varchar(4), p_companyId varchar(255))
BEGIN
	#drop temp table if exists
	drop temporary table if exists temp_score; 
	#create temp tables	
	create temporary table temp_score(year varchar(4), score decimal(18,2));
	#insert into temp tables
	insert into temp_score set year = '2020', score ='90'; 
	insert into temp_score set year = '2021', score ='90.3'; 
	insert into temp_score set year = '2022', score ='93.75'; 
	select * from temp_score;
	drop temporary table if exists temp_score; 
	
    END */$$
DELIMITER ;

